import React from 'react'

export default function Contact() {
  return (
    <div>
      <h1>Contact Us</h1>
      <p>Need additional information, want to report a defect or have a question or comment? Use below form or email us at contactus@webtools.services to share your feedbacks and experience about our services.</p>
    </div>
  )
}
